# Crear un objeto BeautifulSoup para analizar (parsear) el HTML
soup = BeautifulSoup(html_data, 'html.parser')

# --- CAMBIO AQUÍ ---
# 1. Se busca la etiqueta <span> en lugar de <div>.
# 2. Se usa la nueva clase 'value--dd5c7' para identificar los elementos.
spans_numeros = soup.find_all('span', class_='value--dd5c7')

# Lista para guardar los números extraídos
numeros_extraidos = []

# Iterar sobre cada span encontrado
for span in spans_numeros:
    # --- CAMBIO AQUÍ ---
    # Se extrae el texto de forma más directa con .text
    numero_texto = span.text.strip()
    if numero_texto:
        numeros_extraidos.append(int(numero_texto))

# En el script original, los números se invertían. Se mantiene esa lógica.
# Si no quieres invertirlos, puedes usar la lista 'numeros_extraidos' directamente.
numeros_al_reves = numeros_extraidos[::-1]


# Imprimir la lista de números en el orden deseado
print("Números extraídos:")
print(numeros_al_reves) # O imprime 'numeros_extraidos' si no necesitas invertirlos

# Imprimir la cantidad de números encontrados
print(f"\nSe encontraron un total de {len(numeros_al_reves)} números.")